import React from 'react';
import { Box, Typography, makeStyles }
  from '@material-ui/core';
import NavBar from './components/navBar/index';
import BGImage from './images/arif-wahid-y3FkHW1cyBE-unsplash.png';


const useStyles = makeStyles(theme => ({
  root: {
    height: '100vh',
    width: '100vw',
    flexGrow: 1,
    backgroundColor: theme.palette.backgroundColor.color,
    // backgroundImage: `url(${BGImage})`,
    backgroundSize: 'cover',
    overflow: 'hidden',
    backgroundRepeat: 'no-repeat',
    backgroundPosition: 'center',
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    marginTop: '100px',
    display: "flex",
    justifyContent: "center",
    color: 'white'
  },
  textBox: {
    display: 'flex',
    alignItems: 'center'
  },
  test: {
    boxShadow: theme.palette.backgroundColor.boxShadow,
    backgroundColor: theme.palette.backgroundColor.color
  }
}));

const App = () => {
  const classes = useStyles();
  const [bgColor, setBgColor] = React.useState('#B3D2E6');

  return (
    <Box >
      <NavBar />
      <Box
        // p={5}
        className={classes.root}
        // bgcolor={bgColor}
        // width={'100%'}
        // height={'100%'}
        display={'flex'}
        justifyContent={'center'}
        alignItems={'center'}
        // flex={1}
      >
        <Box className={classes.test} borderRadius={16} width='75%' height='70%' />
      </Box>
    </Box>
  );
}

export default App;
